import React from 'react'

const Navigtn = ({menuData}) => {
    return (
        <>
        {menuData.map((curr)=>{
            const {category}=curr ;
            return(
          <nav className="navbar">
          <div className="btn-group">
          <button className="btn-group__item" >
            {category}
          </button>
         </div>
          </nav>
            )
        })}
           
        </>
    )
}

export default Navigtn
